import React from 'react';
import '../styles/Videos.css'; // Link the CSS file for Videos

function Videos() {
  return (
    <div className="videos-container">
      <h1>Welcome to the Videos Page</h1>
      <p>Explore our video content here.</p>
    </div>
  );
}

export default Videos;
